const timers = [
  {
    order: 1,
    seconds: 10,
    title: 'Train',
    color: 'green'
  },
  {
    order: 2,
    seconds: 20,
    title: 'Rest',
    color: 'blue'
  },
  {
    order: 3,
    seconds: 40,
    title: 'Trian',
    color: 'red'
  }
];


export default timers;
